INSERT INTO `api_copywriting` VALUES (1479002302328233985, '你要想找一帅哥就别来了，你要想找一钱包就别见了。硕士学历以上的免谈，女企业家免谈(小商小贩除外)，省得咱们互相都会失望。刘德华和阿汤哥那种才貌双全的郎君是不会来征你的婚的，当然我也没做诺丁山的梦，您要真是一仙女我也接不住。没期待您长得跟画报封面一样看一眼就魂飞魄散；外表时尚，内心保守，身心都健康的一般人就行。要是多少还有点婉约那就更靠谱了。我喜欢会迭衣服的女', '非诚勿扰', '2022-01-06 16:10:02', 3);
