INSERT INTO `api_copywriting` VALUES (1479093897797517314, '童年，只有在回忆中显现时才成就了那么完美。', '三毛', '2022-01-06 22:14:00', 1);
INSERT INTO `api_copywriting` VALUES (1479093901761134593, '人生得意须尽欢，胡吃海喝需尽兴。', '佚名', '2022-01-06 22:14:01', 1);
INSERT INTO `api_copywriting` VALUES (1479094401113997313, '世上再美的风景，都不及回家的那段路。', '佚名', '2022-01-06 22:16:00', 1);
INSERT INTO `api_copywriting` VALUES (1479094405094391809, '能轻易失去的东西，确实谈不上多遗憾。', '佚名', '2022-01-06 22:16:01', 1);
INSERT INTO `api_copywriting` VALUES (1479094904669552641, '用善意的心情去理解别人的话，会让世界单纯美好容易。世界如此之大，我却能幸运地遇见一些人。', '佚名', '2022-01-06 22:18:00', 1);
INSERT INTO `api_copywriting` VALUES (1479094908368928769, '留不住的人没必要强求，不合适的人终究会分开，可以不聪明，但别不清醒。', '佚名', '2022-01-06 22:18:01', 1);
INSERT INTO `api_copywriting` VALUES (1479095407772123137, '应是青山难相见，许得枯木不逢春。', '佚名', '2022-01-06 22:20:00', 1);
INSERT INTO `api_copywriting` VALUES (1479095411706380290, '荣耀的这条路上，脚印变得越来越少，如今只剩下我两行的脚印了。', '佚名', '2022-01-06 22:20:01', 1);
INSERT INTO `api_copywriting` VALUES (1479095911394787330, '其实“醉生梦死”只不过是她跟我开的一个玩笑，你越想知道自己是不是忘记的时候，你反而记得清楚。我曾经听人说过，当你不能够再拥有，你唯一可以做的，就是令自-己不要忘记。', '东邪西毒', '2022-01-06 22:22:00', 3);
INSERT INTO `api_copywriting` VALUES (1479095915006083074, '在这个上了床也没有结果的年代里，曾经那些牵过手就是一生的爱情，已经很远了…… ', '天下有情人', '2022-01-06 22:22:01', 2);
INSERT INTO `api_copywriting` VALUES (1479096414317002753, '挂居，我一直喜欢着你，一直无法忘记你，即使物转星移、口红改变了；即使明日会四分五裂，我的心一直不变，在四年前一样的地方。不管再怎么痛苦，如何烦恼，再怎么没办法，即使说一定要忘记你，还是办不到，还是那么喜欢你，不能从这种心情中逃跑。挂居，我还是喜欢你。', '爱情白皮书', '2022-01-06 22:24:00', 3);
INSERT INTO `api_copywriting` VALUES (1479096418326757377, '美的事物在人心中唤起的那种感觉，是类似我们当着亲爱的人的面前时，洋溢于我们心中的喜悦', '车尔尼雪夫斯基', '2022-01-06 22:24:01', 4);
INSERT INTO `api_copywriting` VALUES (1479096917797060609, '北京时间，1点25分。先天性心脏病，医生告诉说，有可能活不过20岁。今年19岁。回想一下，我和我最喜欢的人谈过恋爱了，吃过我最爱的吃的了，去过我喜欢的地方了。常常看见妈妈偷偷抹眼泪，心里好痛啊。我还有我爱着的事物，还有好多好多喜欢的地方没去过呢。我想活下去啊，好想活下去啊。', '可能否', '2022-01-06 22:26:00', 2);
INSERT INTO `api_copywriting` VALUES (1479096921634848769, '六经不能教，当以小说教之；正史不能入，当以小说入之；语录不能渝，当以小说渝之；律例不能治，当以小说治之。', '梁启超', '2022-01-06 22:26:01', 4);
INSERT INTO `api_copywriting` VALUES (1479097420937379842, '思想上的努力，正如可以长出大树的种子一般，在眼睛里是看不见的。但，人类社会生活的明显的变化正发生于其中。', '列·托尔斯泰', '2022-01-06 22:28:00', 4);
INSERT INTO `api_copywriting` VALUES (1479097424963911681, '智慧、友爱，这是照明我们的黑夜的光亮。', '罗曼·罗兰', '2022-01-06 22:28:01', 4);
INSERT INTO `api_english` VALUES (1476878052795064322, 'I wouldn\'t worry about it, if I were you', '如果我是你，我就不会担心。', '2021-12-31 19:29:02');
INSERT INTO `api_english` VALUES (1476880185871278081, 'A money lender serves you in the present tense, lends you in the conditional mood, keeps you in the subjuctive,and ruins you in the future.', '放债的人为你服务时用现在时态,借钱给你时用条件语气,使你常处于虚拟语气之中,并于将来时态中毁掉你.', '2021-12-31 19:37:30');
INSERT INTO `api_english` VALUES (1476880333036822530, 'A man is only as good as what he loves.', '一个人要用他所爱的东西有多好来衡量.', '2021-12-31 19:38:05');
INSERT INTO `api_english` VALUES (1476880793751756802, 'Better wear out shoes than sheets.', '宁愿把鞋子穿漏，不愿把床单磨破。', '2021-12-31 19:39:55');
INSERT INTO `api_english` VALUES (1476880837775171587, 'The people, and the people alone,are the motive force in the making of world history.', '人民，只有人民，才是创造世界历史的动力。', '2021-12-31 19:40:06');
INSERT INTO `api_english` VALUES (1476880868104183811, 'No herb will cure love.', '相思病无药医.', '2021-12-31 19:40:13');
INSERT INTO `api_english` VALUES (1476880877755277314, 'Arrogance causes nothing but trouble. It is wiser to ask for advice.', '妄自尊大只会带来麻烦.聪明的作法是虚心问人.', '2021-12-31 19:40:15');
INSERT INTO `api_english` VALUES (1476880891223187457, 'Never let your feet run faster than your shoes.', '不要让你的脚跳得比你的鞋子快。', '2021-12-31 19:40:18');
INSERT INTO `api_english` VALUES (1476880897976016899, 'He does not pay attention to anybody.You are wasting your time in persuading him.', ' 他谁的话也不听，你劝他是在浪费时间。', '2021-12-31 19:40:20');
INSERT INTO `api_english` VALUES (1476880907719385090, 'Have a horse of thine own and thou mayest borrow another.', '自己有马后,才可向别人借马.', '2021-12-31 19:40:22');
INSERT INTO `api_english` VALUES (1476880915634036739, 'What did you do the week before last?', ' 上上星期你干了什么？', '2021-12-31 19:40:24');
INSERT INTO `api_english` VALUES (1476881125294710786, 'It is dogged that does it.', '有志者事竞成.', '2021-12-31 19:41:14');
INSERT INTO `api_english` VALUES (1476881163370602498, 'The wages of sin is death.', '为恶者应灭亡。', '2021-12-31 19:41:23');
INSERT INTO `api_english` VALUES (1476884137341853698, 'Where there is unity, there is victory. / Victory belongs to those who are united.', '有团结就有胜利.', '2021-12-31 19:53:12');
INSERT INTO `api_english` VALUES (1476902183930351617, 'Please show me the menu', '请把菜单给我。', '2021-12-31 21:04:55');
INSERT INTO `api_english` VALUES (1476922534471069698, 'Forbidden fruit is sweet.', '禁果分外甜。', '2021-12-31 22:25:47');
INSERT INTO `api_english` VALUES (1476931391452803073, 'What are you talking about?', '你在说什么?', '2021-12-31 23:00:58');
INSERT INTO `api_english` VALUES (1476934533863047170, 'Knowledge makes one laugh, but wealth makes one dance.', '知识使人笑逐颜开,财富使人手舞足蹈.', '2021-12-31 23:13:28');
INSERT INTO `api_english` VALUES (1476937433964216321, 'A good reputation sits still;a bad one runs about.', '好名不出门，恶名传四方。', '2021-12-31 23:24:59');
INSERT INTO `api_english` VALUES (1476938192541843457, 'It\'s but little good you\'ll do a-watering the last year\'s crop.', '为去年的庄稼浇水徒劳无功。', '2021-12-31 23:28:00');
INSERT INTO `api_english` VALUES (1477173334451634179, 'The fly that sips treacle is lost in the sweet.', '啜饮蜜糖的苍蝇在甜蜜中丧生.', '2022-01-01 15:02:22');
INSERT INTO `api_english` VALUES (1477190188096249858, 'All is not at hand that helps.', '世间没有唾手可得之事.', '2022-01-01 16:09:20');
INSERT INTO `api_english` VALUES (1477222528432431105, 'Is that girl a student?', ' 那个女孩是学生吗？', '2022-01-01 18:17:51');
INSERT INTO `api_english` VALUES (1477224022384795649, 'Open confession is good for the soul.', '坦然承认错误，有益于灵魂。', '2022-01-01 18:23:47');
INSERT INTO `api_english` VALUES (1477226942320828418, 'Keep me away from the wisdom which does not cry,the philosophy which does not laugh and the greatness which does not bow before children.', '请使我远离没有眼泪的智慧，没有欢笑的哲学，和不肯向孩子低头的伟大。', '2022-01-01 18:35:23');
INSERT INTO `api_english` VALUES (1477285925140246530, 'You look radiant tonight.', ' 你今晚真是光彩照人。', '2022-01-01 22:29:46');
INSERT INTO `api_english` VALUES (1477304215522705409, 'The moon is a moon still, whether it shine or not.', '月明月暗，终不失其为月亮。', '2022-01-01 23:42:27');
INSERT INTO `api_english` VALUES (1477497718840164353, 'While the grass grows the horse starves.', '等到草长出来,马已经饿死. / 远水不救近火.', '2022-01-02 12:31:21');
INSERT INTO `api_english` VALUES (1477501393360846850, 'If we command our wealth,we shall be rich and free;if our wealth commands us,we are poor indeed.', '如果我们能支配财富,就会富裕而自由;如果我们听任财富支配,我们就会真正贫穷.', '2022-01-02 12:45:57');
INSERT INTO `api_english` VALUES (1477546680179687425, 'Cross your t\'s and dot your i\'s.', '办事要一丝不苟.', '2022-01-02 15:45:55');
INSERT INTO `api_english` VALUES (1477642685352968194, 'He that plants trees loves others besides himself.', '植树的人,不但爱已,而且爱人.', '2022-01-02 22:07:24');
INSERT INTO `api_english` VALUES (1478615402870386690, 'All good things are cheap, all bad things are very dear.', '一切好的东西都是便宜的,所有坏的东西都是非常贵的.', '2022-01-05 14:32:38');
INSERT INTO `api_english` VALUES (1478656280041271297, 'Let well alone.', '不要画蛇添足. /事已成功,不必多弄.', '2022-01-05 17:15:04');
INSERT INTO `api_english` VALUES (1478738809123987458, 'Care killed a cat.', '忧虑能杀人。', '2022-01-05 22:43:00');
INSERT INTO `api_english` VALUES (1478907975937712129, 'Youth is the season of hope.', '青春是希望的季节.', '2022-01-06 09:55:13');
INSERT INTO `api_english` VALUES (1478993274768351233, 'A great dowry is a bed full of brambles.', '满屋的嫁妆犹如满床荆棘.', '2022-01-06 15:34:10');
INSERT INTO `api_english` VALUES (1479067162758561793, 'Better master one than engage with ten.', '十事半通,不如一事精通.', '2022-01-06 20:27:46');
INSERT INTO `api_english` VALUES (1479095617684455425, 'You have to believe in yourself.That\'s the secret of success.', '人必须相信自已,这是成功的秘诀.', '2022-01-06 22:20:50');
