INSERT INTO `api_log` VALUES (1476048581294194690, '天行-经典台词', 'http://api.tianapi.com/dialogue/index', 'Get', 'RequestBody(key=1fd6144ec54f049a7c64e575f7c4600a)', 'Optional[{\"msg\":\"success\",\"code\":200,\"newslist\":[{\"dialogue\":\"李大人，所谓胜者为王，败者为寇。刚才天炮一响，如果没有天灯挡枪的话，胜负归谁还真没人知道，现在金牌在我黄某的手上，并非我赢了。大人为了大显我民神威而办的这场狮王争霸，死伤那么多人，在世人面前，其实我们都输了。以小民之见，我们不仅要练武强身，以抗外敌，更重要的还是广开民智，智武合一，那才是国富民强之道。区区一个牌子能否改变国运，还请李大人三思。这金牌 就留着给\",\"english\":\"\",\"source\":\"狮王争霸\",\"type\":1}]}]', 1, '2021-12-29 12:33:00');
