INSERT INTO `api_log` VALUES (1476934167029301250, '天行-经典台词', 'http://api.tianapi.com/dialogue/index', 'Get', 'RequestBody(key=1fd6144ec54f049a7c64e575f7c4600a, format=null, word=null)', 'Optional[{\"msg\":\"success\",\"code\":200,\"newslist\":[{\"dialogue\":\"很多时候，爱一个人爱得太深，人会醉，而恨得太久，心也容易碎。世间最痛苦的事莫过于等待，我不知道她等了我多久，我一直以为我不会再有机会见到她，突然间，我-不知道该怎么开口，不知道怎么讲第一句话，告诉她，我真的很爱她。原来尘世间有很多烦恼是很容易解决的，有些事只要你肯反过来看，你会有另外一番光景，我终于明-白，镜花水月是什么意思，其实情之所至，应该你中有我，我中\",\"english\":\"\",\"source\":\"天下无双\",\"type\":1}]}]', 1, '2021-12-31 23:12:00');
