INSERT INTO `api_log` VALUES (1479096414312808450, '天行-经典台词', 'http://api.tianapi.com/dialogue/index', 'Get', 'RequestBody(key=1fd6144ec54f049a7c64e575f7c4600a, format=null, word=null)', 'Optional[{\"msg\":\"success\",\"code\":200,\"newslist\":[{\"dialogue\":\"挂居，我一直喜欢着你，一直无法忘记你，即使物转星移、口红改变了；即使明日会四分五裂，我的心一直不变，在四年前一样的地方。不管再怎么痛苦，如何烦恼，再怎么没办法，即使说一定要忘记你，还是办不到，还是那么喜欢你，不能从这种心情中逃跑。挂居，我还是喜欢你。\",\"english\":\"\",\"source\":\"爱情白皮书\",\"type\":1}]}]', 1, '2022-01-06 22:24:00');
